import React from 'react'
import store from './store'

export default function NoteContainer(props) {
  const note = store.find(n =>
    n.id === props.match.params.noteId
  )
  return (
    <article className='Note'>
      <h2>{note.name}</h2>
      {note.content.map((n, i) =>
        (n === '')
          ? <br key={i} />
          : <n key={i}>{n}</n>
      )}
    </article>
  )
}


